import React from 'react';


class AppDrawer extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            active: false,
        }
    }

    render() {
        return (
            <React.Fragment>
                <ul>
                    <li>Home</li>
                    <li>Projects</li>
                    <li>Research</li>
                    <li>Skills</li>
                    <li>Education</li>
                    <li>Resume</li>
                </ul>
            </React.Fragment>
        );
    }
}

export default AppDrawer;
